import { View, Text, TouchableOpacity, TextInput, Image, ImageBackground } from 'react-native'

export default function DetalhesDosProdutos({navigation}){
    return(
        <View style={{width: '100%', height: '100%', backgroundColor: 'white'}}>
           <ImageBackground style={{width: '100%', height: 300}} source={require('../assets/rectangle 52.svg')}>
                <View style={{width: '50%', height: 50, display: 'flex', justifyContent: 'space-between', alignItems: 'center', alignContent: 'center'}}>
                    <Text style={{fontSize: 17, fontWeight: 'bold', textAlign: 'center'}}>Brócolis</Text>
                    <Image style={{width: 60, height: 60}} source={require('../assets/botão voltar.svg')}></Image>
                </View>
           </ImageBackground>
            
        </View>
    )
}
